//Parse request
def CustServiceTsRequestValue = testRunner.testCase.testSuite.testCases["customerCustomerRepositoryV1Save TestCase"].testSteps["customerCustomerRepositoryV1Save"].getPropertyValue("Request")

//Create the object of XmlHolder class and parse the request variable value
def parseRequest = new XmlHolder(CustServiceTsRequestValue)
//Add the values to respective nodes - use the setNodeValue
parseRequest.setNodeValue("//customer/email", varEmail)
parseRequest.setNodeValue("//customer/firstname", varFirstName)
parseRequest.setNodeValue("//customer/lastname", varLastName)
parseRequest.setNodeValue("//customer/dob", varDOB)

parseRequest.setNodeValue("//customer/addresses/item/region/regionCode", varregionCode)
parseRequest.setNodeValue("//customer/addresses/item/region/region", varState)
parseRequest.setNodeValue("//customer/addresses/item/countryId", varCountryID)
parseRequest.setNodeValue("//customer/addresses/item/street/item", varStreet)
parseRequest.setNodeValue("//customer/addresses/item/telephone", varTelephone)
parseRequest.setNodeValue("//customer/addresses/item/postcode", varPostCode)
parseRequest.setNodeValue("//customer/addresses/item/city", varCity)
parseRequest.setNodeValue("//customer/addresses/item/firstname", varFirstName)
parseRequest.setNodeValue("//customer/addresses/item/lastname", varLastName)

//save the new xml using the getXML() method of XmlHolder class
def newXMLCustTS = parseRequest.getXml()
log.info newXMLCustTS

//Add the new xml to the REQUEST variable of customerCustomerRepositoryV1Save Test Step
testRunner.testCase.testSuite.testCases["customerCustomerRepositoryV1Save TestCase"].testSteps["customerCustomerRepositoryV1Save"].setPropertyValue("Request",newXMLCustTS)
def pointerCustTS = testRunner.testCase.testSuite.testCases["customerCustomerRepositoryV1Save TestCase"].testSteps["customerCustomerRepositoryV1Save"]

//Use the pointer as a constructor of WsdlTestRunContext class
def contextCust = new WsdlTestRunContext(pointerCustTS)
pointerCustTS.run(testRunner, contextCust)

//parse response
def responseCustService = testRunner.testCase.testSuite.testCases["customerCustomerRepositoryV1Save TestCase"].testSteps["customerCustomerRepositoryV1Save"].getPropertyValue("Response")
log.info responseCustService

def parseResponse = new XmlHolder(responseCustService)

def RespCustID = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/addresses/item/customerId/text()")
//Set the property value in the Test suite
testRunner.testCase.testSuite.project.testSuites["customerCustomerRepositoryV1Binding TestSuite"].setPropertyValue("CustomerID", RespCustID)

//Fetch Values from response
def RespDOB = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/dob/text()")
def RespEmail = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/email/text()")
def RespFirstName = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/firstname/text()")
def RespLastName = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/lastname/text()")
def RespState = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/addresses/item/region/region/text()")
def RespregionCode = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/addresses/item/region/regionCode/text()")
def RespCountryId = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/addresses/item/countryId/text()")
def RespStreet = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/addresses/item/street/item/text()")
def RespTelephone = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/addresses/item/telephone/text()")
def RespPostCode = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/addresses/item/postcode/text()")
def RespCity = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/addresses/item/city/text()")
def RespaddFirstName = parseResponse.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/addresses/item/firstname/text()")
